import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">


        <Switch>
          <Route path ="/">
            <Home />
          </Route>

        </Switch>

      </div>
    </Router>
  );
}

export default App;
